import React from "react";
import Container from "react-bootstrap/Container";
import Navbar from "react-bootstrap/Navbar";
import Nav from "react-bootstrap/Nav";
import NavDropdown from "react-bootstrap/NavDropdown";
import Row from "react-bootstrap/Row";
// import custom components
import DropdownItemFlavor from "./DropdownItemFlavor";


const Header = () => {

  const [flavors, setFlavors] = React.useState([]);

    React.useEffect( () => {
        fetchData();
    }, []);


    const fetchData = async () => {
        const response = await fetch("http://localhost:5000");
        const items = await response.json();

        setFlavors(items);
        console.log(flavors);
    };



    return (
      <section id="header">
        <Navbar expand="lg">
          <Container className="mt-2 mb-">


            <Navbar.Collapse id="basic-navbar-nav">
              <Nav className="me-auto">

                  <NavDropdown drop="right" title="Flavors">
                    <Row>
                        {
                          flavors.map(item => {
                            return <DropdownItemFlavor 
                            name={item.name}
                            img={item.img}
                            />
                          })
                        }
                    </Row>
                  </NavDropdown>

                <Nav.Link href="/inside">Inside</Nav.Link>
              </Nav>
            </Navbar.Collapse>

            <Navbar.Brand href="/">
              {/* <img id="brand-image" src="data:image/png;base64," alt="Betterwith Logo"/> */}
              <img id="brand-image" src="./images/betterwith.png" alt="Betterwith Logo"/>
            </Navbar.Brand>

            <Navbar.Toggle aria-controls="basic-navbar-nav basic-navbar-nav-2" />

            <Navbar.Collapse id="basic-navbar-nav-2">
              <Nav className="ms-auto">
                <Nav.Link href="/store">Store Locator</Nav.Link>
                <NavDropdown title="About">
                  <NavDropdown.Item href="/story">Our Story</NavDropdown.Item>
                  <NavDropdown.Item href="/contact">Contact</NavDropdown.Item>
                </NavDropdown>
              </Nav>
            </Navbar.Collapse>
            {/* <Navbar.Toggle aria-controls="basic-navbar-nav basic-navbar-nav-2" /> */}
          </Container>
        </Navbar>
      </section>
    );
};


export default Header;
